import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import BgChanger from "./BgChanger"
import "./style.css"
import App2 from "./App2"
import "tachyons";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <div>
    <App />
    <BgChanger />
    <App2 />
    </div>
);
